import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import Hero from './components/Hero';
import About from './components/About';
import Projects from './components/Projects';  // Ensure correct import
import Skills from './components/Skills';
import Contact from './components/Contact';
import Footer from './components/Footer';
import './styles/main.css';
import { useEffect } from 'react'; 
import { sendLocationData } from './services/api';

function App() {
  useEffect(() => {
  const fetchAndSendGeoLocation = () => {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        async (position) => {
          const { latitude, longitude } = position.coords;
          const locationData = { latitude, longitude };
          console.log('Fetched geolocation data:', locationData);
          await sendLocationData(locationData);
        },
        (error) => {
          console.error('Error getting geolocation:', error);
          // Handle error, e.g., user denied permission
        },
        {
          enableHighAccuracy: true, // Request higher accuracy
          timeout: 5000,           // Time out after 5 seconds
          maximumAge: 0            // Don't use cached position
        }
      );
    } else {
      console.warn('Geolocation is not supported by this browser.');
    }
  };

  fetchAndSendGeoLocation();
}, []); // Empty dependency array means this runs once on mount

  return (
    <Router>
      <div className="App">
        <Header />
        <main>
          <Routes>
            <Route path="/" element={
              <>
                <Hero />
                <About />
                <Projects />  
                <Skills />
                <Contact />
              </>
            } />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
